  true,\n\t\"url\": null,\n\t\"notes\": \"<p>The National Database for Clinical Trials
  Related to Mental Illness (NDCT) is an extensible informatics platform for relevant
  data at all levels of biological and behavioral organization (molecules, genes,
  neural tissue, behavioral, social and environmental interactions) and for all data
  types (text, numeric, image, time series, etc.) related to clinical trials funded
  by the National Institute of Mental Health. Sharing data, associated tools, methodologies
  and results, rather than just summaries or interpretations, accelerates research
  progress. Community-wide sharing requires common data definitions and standards,
  as well as comprehensive and coherent informatics approaches for the sharing of
  de-identified human subject research data. Built on the National Database for Autism
  Research (NDAR) informatics platform, NDCT provides a comprehensive data sharing
  platform for NIMH grantees supporting clinical trials.</p>n\",\n\t\"license_title\":
